import React, { useState } from 'react';
import reactDom from 'react-dom';
import "./index.css";

const App = () => {
    const changeBg = () => {
        console.log("clicK");
    }
  
  
    return(
        <>
        <div>
        <button onClick={changeBg}>Click Me</button>
        </div>
    </>

    );

}



export default App;
